async()=>{import_allure_reporter.default.addFeature("Contact us page - invalid Submission");import_allure_reporter.default.addDescription("Validate contact Us page by not submitting all data");import_allure_reporter.default.addSeverity("Medium");import_contact_us.default.submitForm("Sarah","Bivolaru","valymachine@yahoo.com","blabla!");const unsuccessfulSubmissionHeader=await $("body");const bodyText=await unsuccessfulSubmissionHeader.getText();assert.ok(bodyText.includes("Error: all fields are required"),`Missing expected message: 'Error: all fields are required'
Actual: ${bodyText}`);assert.ok(bodyText.includes("Error: Invalid email address"),`Missing expected message: 'Error: Invalid email address'
Actual: ${bodyText}`)}

